# This file has dtmf tones approx every 0.12 seconds.
# use this https://dtmf.netlify.app/ site with threshold 0.04

dtmf = ''

# This is 0's and 1's with space in between. So I group them in grou p of 3 chars

bits = [chr(int(dtmf[i:i+3])) for i in range(0,942,3)]
# bits = [chr(int(i)) for i in bits.split(' ')]
asci = [int(i, 2) for i in ''.join(bits).split(' ')]

print("FLAG: ", ''.join(chr(i) for i in asci))

# Final flag will be: dOnT_C0me_$tAY_aW@Y_Fr0M_th!s_Pl@cE (wrapped in jctf)
